        body {
            margin: 0;
            padding: 0;
            background: white;
        }

        html, body, canvas {
            margin: 0;
            padding: 0;
            border: 0;
            overflow: hidden;
            background-color: white;
        }

        #canvas-game {
            margin: 0;
            padding: 0;
            width: 100% !important;
            height: 100% !important;
            position: absolute;
            background: white;
            /* touch-action: pan-x pan-y !important;*/
        }

        canvas {

            margin: 0;
            padding: 0;
            border: 0;
            overflow: hidden;
            background-color: white;
            overflow: hidden;

            background: white;
            /*     touch-action: pan-x pan-y !important;*/
        }

        #gui {
            position: absolute;
            top: 2px;
            left: 100px
        }

        div#stats {
            position: fixed;
            top: 0;
            right: 0;
            z-index: 500;
            width: max(200px, 10vw, 10vh);
            height: max(100px, 6vh, 6vw);
            opacity: 0.8;
            user-select: none;
        }


        .closebtn {
            cursor: pointer;
            background-color: #31364b;
            display: block;
            position: absolute;
            width: 5%;
            height: auto;
            right: 0px;
            margin: 10px;
        }

        .info {
            background-color: #31364b;
            display: block;
            position: absolute;
            left: -30%;
            height: 100%;
            width: 30%;
            padding-left: 10px;
            overflow-y: auto;
        }

        .info-text {
            margin-top: 50px;
            box-sizing: border-box;
        }

        .info-text div {
        }

        .info-text .data {
            font-family: Inter;
            margin-top: 10px;
            word-wrap: break-word; /* Перенос длинных слов */
            overflow-wrap: break-word; /* Перенос длинных слов для совместимости */
            white-space: normal; /* Перенос текста */
        }

        .info-text .key-style {
            font-weight: bold;
            color: #fdbf08;
            font-size: 1rem;
        }

        .info-text .value-style {
            color: white;
            font-size: 0.8rem;
        }

        /* Стилизация полосы прокрутки */
        .info::-webkit-scrollbar {
            width: 12px;
        }

        .info::-webkit-scrollbar-track {
            background: #2c2f3a;
            border-radius: 10px;
        }

        .info::-webkit-scrollbar-thumb {
            background: #888;
            border-radius: 10px;
        }

        .info::-webkit-scrollbar-thumb:hover {
            background: #555;
        }

        @media screen and (orientation: landscape) {
            .info {
                background-color: #31364b;
                display: block;
                position: absolute;
                left: -110%;
                height: 100%;
                width: 30%;
                padding: 10px;
                overflow-y: auto;
            }
        }
        .border {
            margin: 4px 0px;
            flex-shrink: 0;
            border-width: 0px 0px thin;
            border-style: solid;
            border-color: rgba(0, 0, 0, 0.12);
            background-color: rgba(159, 158, 158, 0.6);
        }
        @media screen and (orientation: portrait) {
            .info {
                background-color: #31364b;
                display: block;
                position: absolute;
                left: -110%;
                height: 100%;
                width: 70%;
                padding: 10px;
                overflow-y: auto;
            }

        }


        .info-text .key-style {
            color: #15ab5b;
            font-size: 0.875rem;
            line-height: 1.75;
            letter-spacing: 0.08em;
        }

        .info-text .value-style {
            color: white;
            font-size: 0.875rem;
            line-height: 1.75;
            letter-spacing: 0.08em;
            text-transform: uppercase;
        }
    </style>
</head>

            loop() {
            stats.update();

        });

<script type="text/javascript" src="./dat.gui.min.js"></script>
<div style="font-family:'Inter';visibility: hidden;position: relative;height: 0;">taraxa</div>
<div id="canvas-game"></div>
<div class="info">
    <img class="closebtn" src="cross.png">
    <div class="info-text">
        <div class="data" id="hash"></div>
        <div class="data" id="level"></div>
        <div class="data" id="pivot"></div>
        <div class="data" id="sector"></div>
        <div class="data" id="sender"></div>
        <div class="data" id="sig"></div>
        <div class="data" id="timestamp"></div>
        <div class="data" id="tips"></div>
        <div class="data" id="transactions"></div>
        <div class="data" id="trx_estimations"></div>
    </div>
</div>
<script src="http://localhost:35729/livereload.js"></script>
<script src="./pixi.js" type="application/javascript"></script>
<script src="./app.js" type="application/javascript"></script>

<script>
    const colors = {
        green: '#15ab5b',
        darkgreen: '#1d3838',
        darkback: '#000000',
        darkbacklight: '#202436',
        darkblue: '#31364b',
        yellow: '#fdbf08',
        blockcolor: '#0d984d'
    }

    window.showblock = function (data) {
        $.each(data, function (key, value) {
            if (value) {
                var data = value.toString();
                if (key === 'transactions') {
                    data = data.replaceAll(',', '<br><br>');
                }
                if (key === 'tips') {
                    data = data.replaceAll(',', '<br><br>');
                }
                if (key !== 'sector') {


                    var txt = '<span class="key-style">' + key + ':</span><br><span class="value-style">' + data + '</span><hr className="border"><span class="key-style">';
                    $('#' + key).html(txt);
                }
            }
            gsap.to('.info', {duration: 0.5, left: '0', ease: 'sine.out'});
        });
    }

    $(document).ready(function () {
        $('.closebtn').on('click', function () {
            gsap.to('.info', {duration: 0.5, left: '-120%', ease: 'sine.in'});
        });
    });

</script>
